import React, {Component} from 'react';
import {Button, Container, Nav, Navbar, NavDropdown} from "react-bootstrap";

class NavBar extends Component {

    constructor(props) {
        super(props);

        this.onClickActionNavBar = this.onClickActionNavBar.bind(this);
    }


    onClickActionNavBar = (event) => {
        console.log("Action Button Clicked")
    }

    render() {
        return (
            <div>
                <Navbar bg="dark" variant="dark" expand="lg">
                    <Container>
                        <Navbar.Brand href="#home">Airport Management System</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link href="#home">Home</Nav.Link>
                                <NavDropdown title="Flights" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="#action/3.1"
                                                      onClick={this.onClickActionNavBar}>Departure</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.2">Landing</NavDropdown.Item>
                                </NavDropdown>
                                <NavDropdown title="Travel Agency" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="#action/3.1">Employees</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.2">Companies</NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                        </Navbar.Collapse>
                        {/*<Button size="sm" style={{marginRight: "10px"}}>Login as</Button>*/}
                        <h5 style={{color:'#a1d4bc',marginTop : "5px"}}>Login as :</h5>
                        <Button size="sm">Log out</Button>

                    </Container>
                </Navbar>

            </div>
        );
    }
}

export default NavBar;
